    disp('Cipher 1 is a Substitution Cipher')
    plaintext1=Substitution_Cipher(X1)
    elseif Cipher1==4
    disp('Cipher 1 cannot be decrypted because it uses a One Time Pad')
    elseif Cipher1==5
    disp('Cipher 1 is a Vignere Cipher')
    plaintext1=Vignere_cipher_Seif(X1)'
end

